import Expenseitem from "./components/Expenseitem";
import Footer from "./components/Footer";
import Product from "./Product";



function App() {

  const product  = [

    {

     name : 'Echo Amazon',
     description  : 'This is amazon  product',
     price : '50.00',



    }



  ]



  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },

  ];

  return (
    <div>

      <Expenseitem title={expenses[0].title} amount={expenses[0].amount} id={expenses[0].id} date = {expenses[0].date}> </Expenseitem>
      <Expenseitem title={expenses[1].title} amount={expenses[1].amount} id={expenses[1].id} date = {expenses[1].date} > </Expenseitem>
      <Expenseitem title={expenses[2].title} amount={expenses[2].amount} id={expenses[2].id}date = {expenses[2].date} > </Expenseitem>
      <Expenseitem title={expenses[3].title} amount={expenses[3].amount} id={expenses[3].id}date = {expenses[3].date} > </Expenseitem>
      <Product Name= {product[0].Name }  description = {product[0].description}  price = {product[0].price}/>





    </div>
  );
}

export default App;
